Aedeagus (
Fig. 15
) main-piece much wider distally than at base, with small, hook-like process on apical part of right side; distal piece (ventral view) with two lobes and two curving flagella; parameres simple, left slightly longer than right. Female last tergite with small apicomedian incision, setae slender, tapering; gonocoxite as illustrated (Fig. 210).
